class Projects {
    constructor(title: string, shortDescription: string, description: string, imagePath: string, tags: string[], githubLink: string, carouselImagePath: string[], year: Date, tools: string[], isFeatured: boolean) {
        this.description = description;
        this.title = title;
        this.imagePath = imagePath;
        this.tags = tags;
        this.githubLink = githubLink;
        this.carouselImagePath = carouselImagePath;
        this.shortDescription = shortDescription;
        this.year = year;
        this.tools = tools;
        this.isFeatured = isFeatured;
    }

    title: string;
    description: string;
    imagePath: string;
    tags: string[];
    githubLink: string;
    carouselImagePath: string[];
    shortDescription: string;
    year: Date;
    tools: string[];
    isFeatured : boolean;
}
